import React from 'react';

import { useState, useEffect } from 'react';

import Card from 'react-bootstrap/Card';

const Lift = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch('http://127.0.0.1:8000//api/lift/status/')
      .then((res) => {
        console.log(res)
        return res.json();
      })
      .then((data) => {
        console.log(data["lifts"]);
        setData(data["lifts"]);
      });

      const intervalId = setInterval(() => {
        fetchData(); // Fetch data every 2 minutes
      }, 120000);

      return () => clearInterval(intervalId);
  }, []);
  return ( <div>
        {data.map((lift, index) => ( 
            <Card>
                <Card.Body>
                    <Card.Title>Lift number {index}</Card.Title>
                    <Card.Text>{lift["floor"]}</Card.Text>
                </Card.Body>
            </Card>
        )) } </div>
        )
};
export default Lift;
